import React, {Component} from "react"

class ShopingList extends React.Componant {
    render() {
        return (
            <div className="shoping-list">
                <h1>shoping list for </h1>
                <ul>
                    <li>Instagram</li>
                    <li>Whatsapp</li>
                    <li>Facebook</li>
                </ul>
            </div>
        )

    }
}
export default ShopingList;
